data:
  definition: système de canalisation fermé constitué de conduits et d'accessoires
    de conduits pour la protection et le rangement des conducteurs ou des câbles isolés
    dans les installations électriques ou de télécommunication, permettant leur mise
    en place par tirage ou leur remplacement, sans insertion latérale
